import React from "react";
import ReactDOM from "react-dom";
import "./grid.css";
import NavBar from "./components/NavBar";
import "./App.css";
import Greeting from "./components/Greeting";

/* CAC COMPONENT TRONG PJ NAY: 
 - NavBar 
 - Introduction 
 - PortItem 
 - ResumeItem
 - Comment
 - Services 
 - Contact 
 - Info 
*/

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      navBar: ["TRANG CHỦ", "PORTFOLIO", "RESUME", "VỀ TÔI", "LIÊN HỆ"],
      linkContent: ["Mockup", "Poster", "Pics", "Ấn phẩm", "Truyền thông"],
    };
  }

  render() {
    return (
      <div className="body">
        <div className="cover">
          <NavBar content={this.state.navBar} />
          <Greeting />
        </div>

        <div className="portfolio">
          <h1> Sản phẩm từng thực hiện </h1>
          <NavBar style={{ zIndex: "1000" }} content={this.state.linkContent} />
        </div>
      </div>
    );
  }
}
export default App;
